// MovieList.js
import React from 'react';
import MovieCard from './MovieCard';

const MovieList = ({ movies, addToFavorites, favorites }) => {
  return (
    <div>
      {movies.map((movie) => (
        <MovieCard
          key={movie.id}
          movie={movie}
          addToFavorites={addToFavorites}
          isFavorite={favorites.includes(movie.id)}
        />
      ))}
    </div>
  );
};

export default MovieList;
